import './App.css';
import Header from './Header';
import Footer from './Footer';

import Content from './Content';

function App() {
  return (
    // <div className="App"></div>
    <>
      <div id="root"></div>
      <Header />
      <div class="container-fluid mx-2" id="content" />
      <Content page={window.location.hash} />
      <Footer />
    </>
  );
}

export default App;
